import { View, Text, Image } from 'react-native'
import React, {useState} from 'react'
import { COLORS } from '../../constants';


interface props  {
    data : {
      name : string, 
      machines : number, 
      tables : number, 
      hotel : boolean, 
      restaurant : boolean, 
      parisSportif : boolean, 
      poker : boolean,
      horaire : number[],
      jeux :  string[], 
      jeuxId : number[], 
      eventsId : number[], 
      tournoisId : number[], 
      desc : string,
      region : string, 
      adresse : string, 
      id: number, 
  
  
    }

}

export const Localisation = ({name, adresse, region } : {name : String, adresse : String, region : String}) => {
    return (
        <View
        style={{
            width:"100%", 
            flexDirection:"row", 
            height: 50 ,
            justifyContent:'flex-start',
        }}>
            <View style={{
                width:"30%", 
            }}>
            <Image
              source={require("../../assets/icons8-casino-100.png")}
              resizeMode="contain"
              style={{height: "100%", alignSelf:"center"}}
            />
            </View>

            <Text style={{
                width: "70%",
                alignSelf:"center",
                textAlign:"justify", 
                fontFamily: 'Barlow_500Medium',

            }}> {name} , {adresse}, {region}</Text>

        </View>
    );
}

export const Horaire = ({horaire} : {horaire : number[]}) => {

    return (
    <View
    style={{
        width:"100%", 
        flexDirection:"row", 
        height: 50 ,
        justifyContent:'flex-start',
            }}>
        <View style={{
            width:"30%", 
        }}>
        <Image
          source={require("../../assets/icons8-date-65.png")}
          resizeMode="contain"
          style={{height: "80%", alignSelf:"center", marginTop:"10%"}}
        />
        </View>

        <Text style={{
            width: "70%",
            alignSelf:"center",
            textAlign:"justify", 
            fontFamily: 'Barlow_500Medium',

        }}> {horaire[0]} h - {horaire[1]} h</Text>

    </View>

    )

}


export const Jeux = ({machines, tables, poker, parisSPortif} : { machines : number, tables : number, poker : boolean, parisSPortif : boolean}) => {

    return (
        <View
        style={{
            width:"80%", 
            height: 100 ,
            justifyContent:'flex-start',
            padding: 5,
            marginLeft: 20

                }}>

            
            <View 
            style={{
            width:"100%", 
            height: 50 ,
            justifyContent:'flex-start',
            flexDirection:"row"
                }}>

                {poker &&

                <>

                <View style={{
                    width:"20%", 
                }}>
                    <Image
                    source={require("../../assets/icons8-poker-53.png")}
                    resizeMode="contain"
                    style={{height: "80%", alignSelf:"center", marginTop:"10%"}}
                    />
                </View>
                
                

                <Text style={{
                    width: "30%",
                    alignSelf:"center",
                    textAlign:"justify", 
                    fontSize:12, 
                    fontFamily: 'Barlow_500Medium',     
                }}>poker</Text>

                </>
                }



                {parisSPortif &&
                <>
                <View style={{
                    width:"20%", 
                }}>
                    <Image
                    source={require("../../assets/icons8-bet-on-sport-48.png")}
                    resizeMode="contain"
                    style={{height: "80%", alignSelf:"center", marginTop:"10%"}}
                    />
                </View>
                
                
                <Text style={{
                    width: "30%",
                    alignSelf:"center",
                    textAlign:"justify", 
                    fontSize:12, 
                    fontFamily: 'Barlow_500Medium',     
                }}>paris Sportif</Text>
                </>
                }

            </View>


            <View 
            style={{
            width:"100%", 
            height: 50 ,
            justifyContent:'flex-start',
            flexDirection:"row"
                }}>

                <View style={{
                    width:"20%", 
                }}>
                    <Image
                    source={require("../../assets/icons8-table-60.png")}
                    resizeMode="contain"
                    style={{height: "80%", alignSelf:"center", marginTop:"10%"}}
                    />
                </View>
                

                <Text style={{
                    width: "30%",
                    alignSelf:"center",
                    textAlign:"justify", 
                    fontSize:12, 
                    fontFamily: 'Barlow_500Medium',     
                }}>{tables} tables</Text>





            <View style={{
                    width:"20%", 
                }}>
                    <Image
                    source={require("../../assets/icons8-slot-65.png")}
                    resizeMode="contain"
                    style={{height: "80%", alignSelf:"center", marginTop:"10%"}}
                    />
                </View>
                
                <Text style={{
                    width: "30%",
                    alignSelf:"center",
                    textAlign:"justify", 
                    fontSize:12, 
                    fontFamily: 'Barlow_500Medium',  
                }}>{machines} machines</Text>


            </View>
            
    
            
    
        </View>
    
        )

}




const CasinoInfo = ({data} : props) => {
  return (
    <View
      style={{
        width: "100%",
        backgroundColor:COLORS.BackgroundTwo, 
        borderBottomRightRadius: 20, 
        borderBottomLeftRadius: 20, 
        paddingHorizontal: 10,
        paddingVertical: 5, 
      }}
    >  

      {data.name && <Localisation name={data.name} adresse={data.adresse} region={data.region}/>}
      {data.horaire && <Horaire horaire={data.horaire}/>}
      {data.machines && <Jeux machines={data.machines} tables={data.tables} poker={data.poker} parisSPortif={data.parisSportif}/>}


    </View>
  )
}


export default CasinoInfo
